import React from "react";
import logo from "./logo.png";
import "./App.css";
// import Parallax from "./components/Parallax/Parallax.js";
import {
  Button,
  Navbar,
  Nav,
  Form,
  FormControl,
  Table
} from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

import Scova from './Scova'

function formatVerse(index, verse) {
  // <tr><td colspan=\"2\"  style=\"font-weight: bolder; padding: 15pt 15pt 15pt 57pt;vertical-align: middle;\" >".concat(index.toString(),
  // "</td><td colspan=\"27\" style=\"padding: 15pt 57pt 15pt 15pt;\" class=\"",verse.classes.join(" "),"\"> ", verse.html, "</td></tr>");

const formattedVerse = {
  type: 'button',
  props: {
    className: 'button button-blue',
    children: {
      type: 'b',
      props: {
        children: 'OK!'
      }
    }
  }
}


return formattedVerse

}

const verse = {
  classes: ['Harper'],
  html: <p>Perez</p>
};




function App() {
  return (
    <div className="App">
        <img src={logo} className="App-logo" alt="logo" />

        <Table>

          {formatVerse(1,verse)}

        </Table>


      </div>

  );
}

export default App;
